import { Link } from "react-router-dom";


let Nav =()=>{
    return(
        <div className="nav">
            <Link to="/">Disp user</Link>
            <Link to="/add">Add user</Link>
            <Link to="/edit">Edit user</Link>
            <Link to="/del"> Del user</Link>
        </div>
    )
}
export default Nav;
